import React from 'react'
import { useState } from 'react'; 

export default function Content() {

  const [items, setItems] = useState([
    {
      id: 1, 
      checked: false, 
      item: "One half pund bag of cocoa unsalted etc."
    }, 
    {
      id: 2, 
      checked: false, 
      item: "Items 2"
    }, 
    {
      id: 3, 
      checked: false, 
      item: "Item 3 "
    }, 

  ])

  return (
    <main>
      <ul>
        {items.map}
      </ul>
    </main>
  );
}
